.mock-container {
  padding: 0 30px;

  .mock-header {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-top: 10px;
    margin-bottom: 10px;

    .header-left {
      float: left;

      .name {
        width: 200px;
        margin-right: 10px;
      }
    }

    .header-right {
      float: right;
      display: flex;
      justify-content: space-between;
      align-items: center;
    }
  }

  .GET {
    color: #00C292;
    font-weight: 500;
  }
  .POST {
    color: #409EFF;
    font-weight: 500;
  }
  .PUT {
    color: #E6A23C;
    font-weight: 500;
  }
  .DELETE {
    color: #E46A76;
    font-weight: 500;
  }

  .mock_case {
    display: flex;
    flex-direction: column;
    margin: 20px;

    .base_info {
      display: flex;
      justify-content: space-between;
    }

    .tabs {
      height: 300px;
    }
  }
}
